pub enum Member {

    #[doc = r" A named field like `self.x`."]
    Named(Ident),

    #[doc = r" An unnamed field like `self.0`."]
    Unnamed(Index),
}

pub enum RangeLimits {

    #[doc = r" Inclusive at the beginning, exclusive at the end."]
    HalfOpen(crate::token::Dot2),

    #[doc = r" Inclusive at the beginning and end."]
    Closed(crate::token::DotDotEq),
}

pub enum BareFnArgName {

    #[doc = r" Argument given a name."]
    Named(Ident),

    #[doc = r" Argument not given a name, matched with `_`."]
    Wild(crate::token::Underscore),
}

pub fn parse_separated_nonempty_with(ParseStream,
                                     fn(: ParseStream) -> Result<T>)
-> Result<Self> where P: Token + Parse
